import React from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';
import HomePage from './Pages/HomePage/HomePage.Component';

const TryPage = () => (
  <div> toto </div>
)

function App() {
  return (
    <div className="App">
      <Route exact path="/" component={HomePage} /> 
      <Route path="/try" component={TryPage} />
    </div>
  );
}

export default App;
